// For DomContentLoaded
function danielProcessImages() {
  let images = Array.from(document.getElementsByTagName('img'));
  images.forEach(img => {
    img.src = encodeURI(img.src); // encode URIs because some images have special chars
  });
}

document.addEventListener("DOMContentLoaded", function(event) {
  danielProcessImages();
});

